INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, 1, 122601, 1, 101, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 1.5, 110, 1, 0.029, 0, 1, 0, 160);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (111, 2, 122401, 0, 102, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 2.5, 105, 2, 0.014, 1, 3, 0, 120);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, 3, 122501, 0, 103, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 2.5, 110, 3, 0.017, 0, 2, 1, 350);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, 4, 107501, 0, 104, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 1.5, 110, 4, 0.016, 1, 3, 0, 130);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, 5, 107601, 1, 105, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 2.5, 110, 5, 0.014, 0, 1, 0, 160);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (103, 6, 107801, 0, 106, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 3.5, 120, 6, 0.029, 0, 2, 1, 255);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (103, 7, 110601, 1, 107, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 3.5, 120, 7, 0.013, 0, 1, 0, 160);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (103, 8, 110401, 0, 108, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 2.5, 110, 8, 0.014, 0, 2, 1, 350);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (100, 9, 110501, 0, 109, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 1.5, 105, 9, 0.012, 1, 3, 0, 130);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (103, 10, 115701, 1, 110, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 2.5, 105, 10, 0.014, 0, 1, 0, 200);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (103, 11, 113601, 0, 111, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 2.5, 105, 11, 0.071, 0, 2, 1, 350);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (103, 12, 107901, 0, 112, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 1.5, 120, 12, 0.014, 1, 3, 0, 130);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, 13, 108001, 1, 113, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 1.5, 110, 13, 0.022, 0, 2, 0, 200);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (108, 14, 110301, 1, 114, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 2.5, 110, 14, 0.031, 0, 1, 0, 160);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, 15, 107701, 0, 115, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 0.5, 110, 15, 0.036, 1, 1, 0, 130);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (95, 16, 113101, 0, 116, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 3.5, 110, 16, 0.048, 0, 2, 1, 350);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, 17, 113301, 0, 117, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 1.5, 105, 17, 0.043, 1, 3, 0, 130);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (95, 18, 113201, 0, 118, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 1.5, 105, 18, 0.018, 1, 2, 0, 130);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (108, 19, 117001, 1, 119, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 2.5, 110, 19, 0.021, 0, 2, 0, 160);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, 20, 113501, 0, 120, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 2.5, 110, 20, 0.036, 0, 1, 1, 255);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, 21, 113401, 0, 121, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 2.5, 105, 21, 0.02, 0, 3, 1, 350);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, 22, 110101, 0, 122, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 2.5, 110, 22, 0.018, 1, 1, 0, 130);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (111, 23, 110001, 1, 123, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 3.5, 105, 23, 0.03, 0, 3, 0, 160);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (103, 24, 117201, 0, 124, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 1.5, 110, 24, 0.027, 1, 1, 0, 130);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (108, 25, 117301, 1, 125, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 3.5, 105, 25, 0.02, 0, 2, 0, 160);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, 26, 117401, 0, 126, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 2.5, 110, 26, 0.04, 0, 3, 1, 350);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, 27, 117101, 0, 127, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 3.5, 110, 27, 0.009, 0, 1, 1, 350);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, 28, 122901, 0, 128, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 3.5, 120, 28, 0.022, 0, 1, 1, 255);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, 29, 122801, 0, 129, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 2.5, 110, 29, 0.028, 1, 3, 0, 130);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (108, 30, 122701, 1, 130, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 3.5, 105, 30, 0.023, 0, 2, 0, 130);
